import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import "./global.css";
import WebFont from 'webfontloader';

WebFont.load({
  google: {
    families: ['Raleway:600']
  },
});

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
